import logo from './logo.svg';
import './App.css';

function App() {

  let cantidad =2

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <IntroText name="Lista de tareas" count={cantidad} />
        <a 
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <Producto name="PS5" precio={1500} cantidad={2}></Producto>
        <Producto name="Control PS5" precio={200} cantidad={0}></Producto>
      </header>
    </div>
  );
}

function IntroText ({name,count}){
  return (
    <p>
      Edit <code>src/App.js</code>  <br/>
      {name} {count}<br/> 
      sadasdasda and save to reload, SARASA.
    </p>
  ) 
}

/*
 if( cantidad ==0){
   return 'No hay stock'
 }else {
   return $'Precio USD ${precio}'
 }

