*/

const Producto = ({name,cantidad,precio}) => {
  return (
    <p>
      Nombre: {name}
       {
        cantidad == 0 ?
        'No hay stock' : ` Precio: USD : ${precio}` 
      } 
    </p>
  )
}

export default App;
